import React from "react"
import "../tabProgressTracker.css"

export default function TabStudentProfiles(props) {
  return (
    <div className="mainDiv">
      <div className="innerContainer2">
        <div style={{ backgroundColor: "white", height: "100px", width: "100px" }}>
          <div className="completedProjects">
            <h4>
              {props.user.first_name.toUpperCase() + " "}
              {props.user.last_name.toUpperCase()}
            </h4>
            <img src={props.user.projects} alt="student info" />
          </div>
        </div>
      </div>
    </div>
  )
}
